import Vue from 'vue'
import VueRouter from 'vue-router'
import login from '../views/login.vue'
import login2 from '../views/login2.vue'
import add from '../views/add.vue'

Vue.use(VueRouter)

const routes = [
    {
        path: '',
        redirect: '/login2',

    },
    {
        path: '/login',
        component: login
    },
    {
        path: '/add',
        component: add
    },
    {
        path: '/login2',
        component: login2
    }
]

const router = new VueRouter({
    routes
})
export default router
